import { Facebook, Instagram, Pinterest, Twitter } from "@material-ui/icons"
import styled from "styled-components"

const Container = styled.div`
    display: flex;
`
const Left = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column;
    padding: 20px;
`
const Logo = styled.h1``
const Desc = styled.p`
    margin: 20px 0px;
`
const SocialContainer = styled.div`
    display: flex;
`
const SocialIcon = styled.div`
    width: 40px;
    height: 40px;
    border-radius:50%;
    color: white;
    background-color: #${props => props.color}
    display: flex;
    align-items: center;
    justify-content: center;
`

const Center = styled.div`
    flex: 1;
`
const Right = styled.div`
    flex: 1;
`

const Footer = () => {
    return (
        <Container>
            <Left>
                <Logo>Logo.</Logo>
                <Desc>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Consequatur quasi odio consequuntur laboriosam, et unde dolor delectus! Vel at distinctio, debitis corrupti minus laudantium, voluptas, dolor placeat maxime velit quaerat.</Desc>
                <SocialContainer>
                    <SocialIcon color="3B5999">
                        <Facebook />
                    </SocialIcon>
                    <SocialIcon color="E4405F">
                        <Instagram />
                    </SocialIcon>
                    <SocialIcon color="55ACEE">
                        <Twitter />
                    </SocialIcon>
                    <SocialIcon color="E60023">
                        <Pinterest />
                    </SocialIcon>
                </SocialContainer>
            </Left>
            <Center></Center>
            <Right></Right>
        </Container>
    )
}

export default Footer
